svg.script:
document.getElementById("background").addEventListener("mouseover", sendHoverToParentDocument, false);
document.getElementById("background").addEventListener("mouseout", sendHoverOverToParentDocument, false);
var dotList = document.querySelectorAll(".dot");
//
for (var i = 0; i < dotList.length; i++) {
	dotList[i].addEventListener("mouseover", deactivateOtherDots, false);
	dotList[i].addEventListener("mouseout", activateOtherDots, false);
}
//

function deactivateOtherDots(evt) {
	//
	for (var i = 0; i < dotList.length; i++) {
		dotList[i].style.opacity=0.0;
	}
	//
	evt.target.style.opacity=1.0;
}

function activateOtherDots(evt) {
	console.log("activating others");
	//
	for (var i = 0; i < dotList.length; i++) {

		if (dotList[i] != evt.target) {
			dotList[i].style.opacity=1.0;
		}
	}
	//
}

function sendHoverToParentDocument(evt) {
	console.log("hovering");

	var target = evt.target;

	//
	for (var i = 0; i < dotList.length; i++) {
		dotList[i].style.opacity=1.0;
	}
	//
}

function sendHoverOverToParentDocument(evt) {
	console.log("hovering done");

	var target = evt.target;

	//
	for (var i = 0; i < dotList.length; i++) {
		dotList[i].style.opacity=0.0;
	}
	//
}
